import React, {Component} from "react";

class Timer extends Component {
    constructor(props) {
        super(props);
        this.state = {
            hours:'00',
            minutes:'00',
            seconds:'00'
        }
    }
    
    render () {
        return (
            <input placeholder="enter to do ..."></input>
        );
    }
}

export default Timer;
